import { Navbar, Nav, Container, Row, Col
      } from 'react-bootstrap';
import { Envelope, Linkedin, Github } from 'react-bootstrap-icons';
import NavbarCollapse from 'react-bootstrap/esm/NavbarCollapse';

export const Footer = () => {
    return (
      <footer>
        <Navbar expand="sm" bg="dark" variant="dark">
        <Container>
          <Row>
            <Col>
              <Navbar.Brand>Â© 2021 Juliana F. Borges </Navbar.Brand>
            </Col>
            <Col md={5} className="justify-content-end">
              <Nav.Link href="mailto:fborges.j@gmail.com">
                <Envelope color="white" size="30" />
              </Nav.Link>
              <Nav.Link href="https://www.linkedin.com/in/fborgesj/">
                <Linkedin color="white" size="30" />
              </Nav.Link>
              <Nav.Link href="https://github.com/jufb">
                <Github color="white" size="30" />
              </Nav.Link>
            </Col>
          </Row>
        </Container>
        </Navbar>
      </footer>
  );
}
